description:
Ex Terminators 2009

Verenigde Staten
Komedie / Drama
92 minuten

geregisseerd door John Inwood
met Heather Graham, Jennifer Coolidge en Amber Heard

Alex, Stella en Nikki ontmoeten elkaar bij een cursus woedebeheersing voor 
vrouwen. Nadat ze per ongeluk de schofterige man van een vriendin vermoorden, 
besluiten ze samen een bedrijfje te beginnen. Het doel is om wraak te nemen 
op foute mannen.
